INSERT INTO `notice_board` VALUES ('0a940ce6-29bb-11ee-973f-0242ac110002','f8b81ecb-26cc-11ee-973f-0242ac110002','[긴급] 사무실 장비 점검 안내','<p>[긴급] 사무실 장비 점검 안내<br /></p>',3,1,'2023-07-24 09:43:00'),('2c5be1ac-29bb-11ee-973f-0242ac110002','f8b81ecb-26cc-11ee-973f-0242ac110002','[공지] 크크 하계 휴가 안내','<p>안녕하세요~</p>\r\n<p>크크 가족분들^^</p>\r\n<p>2023년도 크크 컴퍼니의 하계 휴가일정을 아래와 같이 실시하오니 업무에 착오 없도록 하시기 바랍니다.</p>\r\n<p><span style=\"font-weight: bold;\">일시 : 2023년 07월 28일 ~ 7월 30일</span></p>\r\n<p>상기와 같이 휴가를 실시하오니 좋은 추억 만드시기 바랍니다.&nbsp;</p>\r\n<p>위와 같은 일시에 개인적인 사정이나 문제가 있으신 분들은 관리자에게 연락 주시기 바랍니다.</p>',4,1,'2023-07-24 09:43:57'),('6572b520-29cc-11ee-973f-0242ac110002','601a6da6-2763-11ee-973f-0242ac110002','공지사항','<p>테스트</p>',2,1,'2023-07-24 11:47:14'),('eaf4e97e-29ba-11ee-973f-0242ac110002','f8b81ecb-26cc-11ee-973f-0242ac110002','[중요] 편집팀 이전 안내','<p>[중요] 편집팀 이전 안내<br /></p>',2,1,'2023-07-24 09:42:07'),('f09d5fc9-29ba-11ee-973f-0242ac110002','f8b81ecb-26cc-11ee-973f-0242ac110002','[이벤트] 워크샵 참가자 모집','<p>[이벤트] 워크샵 참가자 모집<br /></p>',3,1,'2023-07-24 09:42:17'),('f7595048-29ba-11ee-973f-0242ac110002','f8b81ecb-26cc-11ee-973f-0242ac110002','[안내] 건물 주차장 공사 안내','<p>[안내] 건물 주차장 공사 안내<br /></p>',3,1,'2023-07-24 09:42:28'),('fe3da176-29ba-11ee-973f-0242ac110002','f8b81ecb-26cc-11ee-973f-0242ac110002','[공지] 연차 사용 관련 안내','<p>[공지] 연차 사용 관련 안내<br /></p>',3,1,'2023-07-24 09:42:40');
